/**
 * 添加国家时区卡片
 * @author zhongjyuan
 * @param {string} country - 国家名称
 * @param {string} name - 名称
 * @param {string} timezone - 时区
 * @param {string} position - 位置
 * @param {string} description - 描述
 */
function addCountryTimeCard(country, name, timezone, position, description) {
	// 创建 card 元素
	var cardElement = document.createElement("div");
	cardElement.classList.add("content-" + position + "-card");
	cardElement.setAttribute("name", name);
	cardElement.setAttribute("country", country);
	cardElement.setAttribute("timezone", timezone);

	if (description) {
		cardElement.title = description;
	}

	// 创建包含国旗的元素
	var imageElement = document.createElement("div");
	imageElement.classList.add("content-" + position + "-card-image");
	if (country) {
		imageElement.style.backgroundImage = "url('images/" + country + ".jpg')";
	}

	// 创建顶部内容和底部内容
	var topContentElement = document.createElement("div");
	topContentElement.classList.add("content-" + position + "-card-top");
	if (country) {
		topContentElement.innerText = name + " - " + country;
	} else {
		topContentElement.innerText = name;
	}

	var bottomContentElement = document.createElement("div");
	bottomContentElement.classList.add("content-" + position + "-card-bottom");

	// 更新底部内容函数
	function updateBottomContent() {
        var dateTime = formatTimeZoneDateTime(timezone);
        cardElement.title = dateTime.type7;
		bottomContentElement.innerText = dateTime.type3;
	}

	// 添加点击事件监听
	cardElement.addEventListener("click", (event) => {
		addDateTimeInterval(
			event.currentTarget.getAttribute("country"),
			event.currentTarget.getAttribute("name"),
			event.currentTarget.getAttribute("timezone")
		);
		addTimeStampInterval(
			event.currentTarget.getAttribute("country"),
			event.currentTarget.getAttribute("name"),
			event.currentTarget.getAttribute("timezone")
		);
	});

	// 初始化底部内容
	updateBottomContent();

	// 将顶部和底部内容添加到 card 元素中
	cardElement.appendChild(imageElement);
	cardElement.appendChild(topContentElement);
	cardElement.appendChild(bottomContentElement);

	// 将 card 元素添加到相应位置中
	var positionElement = document.querySelector(".content-" + position + "");
	positionElement.appendChild(cardElement);

	// 每秒更新底部内容
	setInterval(updateBottomContent, 1000); // 1000 毫秒为 1 秒
}

