/**
 * 生成通知弹窗
 * @author zhongjyuan
 * @param {string} type - 弹窗类型
 * @param {string} text - 弹窗文本内容
 * @param {string} layout - 弹窗布局样式
 */
function generate(type, text, layout) {
	// 清空通知队列
	$.noty.clearQueue();
	// 创建通知弹窗
	noty({
		text: text, // 弹窗文本内容
		type: type, // 弹窗类型
		dismissQueue: true, // 是否允许在队列中关闭弹窗
		closeWith: ["click", "backdrop"], // 点击弹窗或背景关闭弹窗
		modal: false, // 是否为模态弹窗
		layout: layout, // 弹窗布局样式
		theme: "relax", // 弹窗主题样式
		maxVisible: 1, // 最大可见弹窗数量
		timeout: 3000, // 弹窗自动关闭的时间间隔（毫秒）
	});
}

/**
 * 复制文本到剪贴板
 * @author zhongjyuan
 * @param {string} text - 要复制的文本
 * @returns {boolean} - 操作是否成功
 */
function copyText(text) {
	// 创建一个 textarea 元素
	var textarea = document.createElement("textarea");
	// 保存当前焦点元素
	var currentFocus = document.activeElement;
	// 将 textarea 添加到文档中
	document.body.appendChild(textarea);
	// 设置 textarea 的值为要复制的文本
	textarea.value = text;
	// 让 textarea 获得焦点
	textarea.focus();
	// 选中整个文本内容
	if (textarea.setSelectionRange) textarea.setSelectionRange(0, textarea.value.length);
	else textarea.select();
	// 尝试执行复制操作
	try {
		var flag = document.execCommand("copy");
	} catch (eo) {
		var flag = false;
	}
	// 移除 textarea 元素
	document.body.removeChild(textarea);
	// 恢复之前的焦点元素
	currentFocus.focus();
	// 返回操作是否成功的标志
	return flag;
}

var shiqu_data = "";
/**
 * 将时间戳转换为对应时区的日期时间并填充到指定元素中
 * @author zhongjyuan
 * @param {Object} obj - 包含时间戳和时区信息的对象
 */
function convert_timestamp(obj) {
	// 获取输入的时间戳
	var js_timestamp = obj.parent().find(".js_timestamp").val();

	// 如果时间戳为空，则显示错误提示并返回
	if (js_timestamp === undefined || js_timestamp == "") {
		generate("error", "请输入时间戳");
		return false;
	}

	// 检查时间戳长度是否合法
	if (js_timestamp.length != 10 && js_timestamp.length != 13) {
		generate("error", "时间戳长度不对");
		return false;
	}

	// 计算本地时区与格林威治时间的毫秒差
	let gm_mini = new Date().getTimezoneOffset() * 60 * 1000;

	// 获取元素上设置的时区信息
	let timezone = parseFloat(obj.attr("data-zone"));

	// 根据时间戳长度不同，计算出对应的日期时间
	let datetime;
	if (js_timestamp.length == 10) {
		datetime = new Date(js_timestamp * 1000 + gm_mini + timezone * 60 * 60 * 1000);
	}
	if (js_timestamp.length == 13) {
		datetime = new Date(js_timestamp * 1 + gm_mini + timezone * 60 * 60 * 1000);
	}

	// 将转换后的日期时间格式化，并填充到指定元素的文本框中
	obj.parent().find(".js_datetime").val(formatDateTime(datetime));
}

/**
 * 获取指定日期的时间戳并填充到对应元素中
 * @author zhongjyuan
 * @param {Object} obj - 包含日期信息的对象
 */
function date_get(obj) {
	// 获取输入的日期
	let data_time = obj.parent().find(".js_date").val();

	// 将日期中的 "-" 替换为 "/"，以便在不同浏览器中兼容
	data_time = data_time.replace(/\-/g, "/");

	// 如果日期为空，则显示错误提示，并返回
	if (data_time === undefined || data_time == "") {
		generate("error", "请选择时间");
		return;
	}

	// 将日期转换成时间戳
	let stamp = new Date(data_time);
	let stamp_show = Math.floor(stamp / 1000);

	// 计算本地时区与格林威治时间的秒差
	let gm_mini = new Date().getTimezoneOffset() * 60;

	// 获取元素上设置的时区信息
	let timezone = parseFloat(obj.attr("data-zone"));

	// 根据时区差调整时间戳
	stamp_show = stamp_show - gm_mini - timezone * 3600;

	// 将时间戳填充到指定元素的文本框中
	obj.parent().find(".js_time_stamp").val(stamp_show);
}

/**
 * 检查时区变化并更新相关时间显示
 * @author zhongjyuan
 */
function check_time_change() {
	// 获取选择的时区数值
	let shiqu_val = $(document).find("#time_data").val();

	// 如果选择的时区值不为空且与之前的值不同
	if (shiqu_val !== undefined && shiqu_val != shiqu_data) {
		shiqu_data = shiqu_val;

		// 获取当前时区对应的数值
		let shiqu = parseFloat(
			$(document)
				.find("#time_data option[value='" + shiqu_val + "']")
				.attr("data-value")
		);

		// 更新展示元素的时区信息
		$("#show_check_data .js_convert_timestamp").attr("data-zone", shiqu);
		$("#show_check_data .js_date_get").attr("data-zone", shiqu);

		// 清空日期时间和时间戳显示
		$("#show_check_data .js_datetime").val("");
		$("#show_check_data .js_time_stamp").val("");

		// 显示相关元素
		$("#show_check_data").show();

		// 如果时间戳输入框有值，则进行时间戳转换
		if ($("#show_check_data .js_timestamp").val()) {
			convert_timestamp($("#show_check_data .js_convert_timestamp"));
		}

		// 如果日期输入框有值，则获取时间戳
		if ($("#show_check_data .js_date").val()) {
			date_get($("#show_check_data .js_date_get"));
		}
	}
}

/**
 * 页面加载完成后的初始化操作
 */
$(function () {
	// 使用插件使下拉框可搜索
	$("#time_data").searchableSelect();

	// 每500毫秒检查时区变化
	setInterval("check_time_change()", 500);

	// 点击重新开始按钮
	$("#restart").on("click", function () {
		$(this).hide();
		$("#stop").show();
		restartTimeStampInterval();
	});

	// 点击停止按钮
	$("#stop").on("click", function () {
		$(this).hide();
		clearInterval(timeStampInfoInterval);
		$("#restart").show();
	});

	// 点击时间戳转换按钮
	$(".js_convert_timestamp").on("click", function () {
		let obj = $(this);
		convert_timestamp(obj);
	});

	// 点击获取日期时间按钮
	$(".js_date_get").on("click", function () {
		let obj = $(this);
		date_get(obj);
	});
});

/**
 * 点击具有类名为 "copy" 的元素复制相应文本到剪贴板并生成成功提示
 */
$(".copy").click(function name(params) {
	// 获取点击元素
	let obj = $(this);
	// 获取当前滚动位置
	var top = $(window).scrollTop();
	// 获取提示标题
	var title = obj.attr("data-title");
	// 获取要复制的文本所在的类名
	var class_data = obj.attr("data-class");
	// 查找并获取要复制的文本内容
	var a = obj
		.parent()
		.find("." + class_data)
		.val();
	// 调用复制文本函数并获取操作结果
	var flag = copyText(a); // 这个必须在 DOM 对象的事件线程中执行
	// 生成成功提示信息
	generate("success", "“" + a + "”" + title + "复制成功！");
	// 恢复滚动位置
	$(window).scrollTop(top);
});

